import React from "react";

export default function About() {
  return (
    <div className="about">
      <h3 className="about--title">About</h3>
      <p className="about--para">
        Je suis un développeur Full Stack, je maîtrise les technologies Node JS
        , Angular , React JS ,, Bootstrap, JAVASCRIPT, JQUERY, 7, Bases de
        Données ( SQL , FireBase, Moongo DB, Elasticsearch).
      </p>
    </div>
  );
}
